import React from 'react';
import styles from './Botton.module.css'

export const BottonUnFollow = (props) => {
    return (
        <button onClick={props.onToogleFollow} className={styles.buttonUnfollow}>unfollow</button>
    )

}

export const BottonFollow = (props) => {
    return (
        <button onClick={props.onToogleFollow} className={styles.buttonFollow}>follow</button>
    )

}
